[InputFile]
path = C:/Users/agarcian/Desktop/FarkFit Data\BC29231-2024-11-06.z

[OutputFile]
path = C:/Users/agarcian/Desktop/FarkFit Data/patatito.csv

[InputFileWidget]
supported_file_extension = .z
skip_rows = 128
freq_column = 0
z_real_column = 4
z_imag_column = 5

[SliderConfigurations]
Linf = EPowerSliderWithTicks,-10,0,black,10
Rinf = EPowerSliderWithTicks,-2,8,black,10
Rh = EPowerSliderWithTicks,-2,8,red,10
Fh = EPowerSliderWithTicks,-2,8,red,10
Ph = DoubleSliderWithTicks,0.0,1.0,red,10
Rm = EPowerSliderWithTicks,-2,8,green,10
Fm = EPowerSliderWithTicks,-2,8,green,10
Pm = DoubleSliderWithTicks,0.0,1.0,green,10
Rl = EPowerSliderWithTicks,-2,8,blue,10
Fl = EPowerSliderWithTicks,-2,8,blue,10
Pl = DoubleSliderWithTicks,0.0,1.0,blue,10
Re = EPowerSliderWithTicks,-2,8,black,10
Qe = EPowerSliderWithTicks,-8,2,black,10
Pef = DoubleSliderWithTicks,0.0,1.0,black,10
Pei = DoubleSliderWithTicks,-0.8,3.2,black,10

[SliderDefaultValues]
defaults = -9.0, 4.0, 5.0, 5.0, 0.8, -1.0, 1.0, 0.5, 4.0, 1.0, 0.5, 8.0, -4.0, 0.5, 0.0

[VariablesToPrint]
variables = file, Rinf, R0, Rh, Qh, Ch, Ph, Fh, pRh, pQh, pCh, Rm, Qm, Cm, Pm, Fm, pRm, pQm, pCm, Rl,	Ql,	Cl,	Pl,	Fl,	pRl,	 pQl	, pCl,	Re,	Qe,	Pef, Pei, Res.1Hz, mismatch,	m0,	mx,	mt,	Vp,	V(.1ms),	 V(1ms), V(10),	V(100),	V(200),	V(400),	V(800),	V(1.2s), V(1.6s), model,	comment, Linf,	Fhigh,	Flow	, date/time

[SeriesSecondaryVariables]
Qh = 1/(Rh*(2*pi*Fh)^Ph)
Qm = 1/(Rm*(2*pi*Fm)^Pm)
Ql = 1/(Rl*(2*pi*Fl)^Pl)

[ParallelModelSecondaryVariables]
R0 = Rinf + Rh + Rm + Rl
pRh = Rinf*(Rinf + Rh)/Rh
pQh = Qh*(Rh/(Rinf + Rh))**2
pRm = (Rinf + Rh)*(Rinf + Rh +Rm)/Rm
pQm = Qm*(Rm/(Rinf + Rh + Rm))**2
pRl = (Rinf + Rh + Rm)*(Rinf + Rh + Rm +Rl)/Rl
pQl = Qm*(Rl/(Rinf + Rh + Rm + Rl))**2

[ModelSecondaryFormulas]
Zinf = (0+1j)*(2*pi*freq)*(Linf) + Rinf
Zarch = (Rh*(1/(Qh*((1j*2*pi*freq)**Ph))))/(Rh+(1/(Qh*((1j*2*pi*freq)**Ph))))
Zarcm = (Rm*(1/(Qm*((1j*2*pi*freq)**Pm))))/(Rm+(1/(Qm*((1j*2*pi*freq)**Pm))))
Zarcl = (Rl*(1/(Ql*((1j*2*pi*freq)**Pl))))/(Rl+(1/(Ql*((1j*2*pi*freq)**Pl))))
Zarce = (Re*(1/(Qe*((1j**Pei)*((2*pi*freq)**Pef)))))/(Re+(1/(Qe*((1j**Pei)*((2*pi*freq)**Pef)))))

[ModelTerciaryFormulas]

[ModelFormula]
formula = Zinf + Zarch + Zarcm + Zarcl + Zarce

